import React from 'react';

function ResourcePolicies() {
  return (
    <div className="resources-container">
      <h2>Company Policies</h2>
      <ul>
        <li>
          <a href="/assets/forms/policy-guide.pdf" target="_blank" rel="noopener noreferrer">
            Download Employee Policy Guide
          </a>
        </li>
      </ul>
    </div>
  );
}

export default ResourcePolicies;
